    private static int validateResponse(ColdStreamData csd) {
        int resetCount = 3199;
        ColdStreamResponse csr = new ColdStreamResponse ();
        if(csd.getResponseCode () == 200){
            if(csd.getColdStreamResponse () != null){
                csr = csd.getColdStreamResponse ();

                String startTime = csr.getStartTime ();
                String stopTime = csr.getStopTime ();
                String downloadedTime = csr.getDownloadDateTime ();
                String downloadUser = csr.getDownloadUser ();
                Integer rcFromResp = csr.getResetCount ();


                if(StringUtils.isNotBlank(startTime) && StringUtils.isNotBlank (stopTime) && StringUtils.isNotBlank (downloadedTime) && StringUtils.isNotBlank (downloadUser)){
                    resetCount =  rcFromResp.intValue () - 1;
                } else {
                    resetCount = rcFromResp.intValue ();
                }

            }
        }



        return resetCount;
    }

    public static List<DataPoint> Decompress(CompressedDatapoint compressedDataPointRecord)
    {
        List<DataPoint> retVal = new ArrayList<DataPoint>();
        int pointNumber = 1;
        int interval = ConvertBytesToInt(compressedDataPointRecord.getInterval (), 4);
        //int interval=21;
        int dataPointLength = compressedDataPointRecord.getDataPoints ().length;


        DataPoint dataPoint;
        for (int i = 0; i < dataPointLength; i += 2)
        {
            dataPoint = new DataPoint();
            dataPoint.PointNumber = pointNumber;
            dataPoint.Time = addSeconds(convertStringToDate(compressedDataPointRecord.getFirstDataPointTime ()), interval * (pointNumber - 1));
//BigDecimal rounded = BigDecimal.valueOf(BigDecimal.valueOf(yourDoubleValueHere).setScale(2, BigDecimal.ROUND_HALF_UP);
            dataPoint.FValue = ConvertBytesToShort(compressedDataPointRecord.getDataPoints (), i)/10;
            //dataPoint.FValue = BigDecimal.valueOf(ConvertBytesToShort(compressedDataPointRecord.getDataPoints (), i)/10).setScale(2, BigDecimal.ROUND_HALF_UP);
            System.out.println ("PointNumber"+dataPoint.PointNumber+" , Time "+dataPoint.Time+" , FValue: "+dataPoint.FValue);
            retVal.add(dataPoint);
            pointNumber++;
            //System.out.println ("============================");
        }
        System.out.println ("dataPointLength: "+dataPointLength+", Interval: "+interval+" compressedDataPointRecord.getFirstDataPointTime: "+compressedDataPointRecord.getFirstDataPointTime());
        DataPoint pointToMark;
        int markedPointLength = compressedDataPointRecord.getMarkedPoints ().length;
        for (int i = 0; i < markedPointLength; i += 4)
        {
            int markedId = ConvertBytesToInt(compressedDataPointRecord.getMarkedPoints (), i);
            pointToMark = retVal.get(markedId);
            pointToMark.IsMarked = true;
        }
        return retVal;
    }

    //public static final String PATTERN = "MM/dd/yyyy HH:mm:ss";
    public static final String PATTERN = "yyyy-MM-dd'T'HH:mm:ss'Z'";


    public static Date convertStringToDate(String dateString) {

        Date convertedDateTime = null;
        if (dateString == null) return null;
        try {
            SimpleDateFormat localFormat = new SimpleDateFormat(PATTERN);
            convertedDateTime = localFormat.parse(dateString);
        } catch (Exception ex) {
            System.out.println("Error in String to Date Conversion : " + ex.getMessage());
        }

        return convertedDateTime;
    }


    private static Date convertStringDate(String firstDataPointTime) {
        Date postFirstParseTime = null;
        try {
            SimpleDateFormat sdf = new SimpleDateFormat("yyyy-MM-dd'T'HH:mm:ss'Z'");
            sdf.setTimeZone(TimeZone.getTimeZone("UTC"));
            postFirstParseTime = sdf.parse (firstDataPointTime);

        } catch (ParseException e) {
            System.out.println ("Error "+e.getMessage ());
            e.printStackTrace ();
        }
        return postFirstParseTime;
    }

    public static Date addSeconds(Date date, long seconds) {
        Calendar cal = Calendar.getInstance();
        cal.setTime(date);
        cal.add(Calendar.SECOND, (int)seconds);
        return cal.getTime();
    }

    private static double ConvertBytesToShort(byte[] byteArray, int startIndex)
    {
        return  (short)((byteArray[startIndex] & 0xFF) << 8 | (byteArray[startIndex + 1] & 0xFF));
    }
    private static int ConvertBytesToInt(byte[] byteArray, int startIndex)
    {
        return ((byteArray[startIndex] << 24 | byteArray[startIndex + 1] << 16) | byteArray[startIndex + 2] << 8) |
                byteArray[startIndex + 3];
    }

    private static String ADD_MONITOR_URL = "https://api.coldstreamselect.com/PublicDownload_v22/api/AddSNs";

    private static void invokeAddMonitorAPI(String deviceId, String apiToken) throws Exception {
        HttpPost httpRequest = new HttpPost(ADD_MONITOR_URL);
        StringEntity entity = null;
        try {
            entity = new StringEntity (buildStringEntity(deviceId));
        } catch (UnsupportedEncodingException e) {
            System.out.println ("Exception "+e.getMessage ());
            e.printStackTrace ();
        }
       httpRequest.setEntity(entity);
        httpRequest.setHeader("Accept", "application/json");
        httpRequest.setHeader("Content-type", "application/json");
        httpRequest.setHeader("Authorization", "Bearer " + apiToken);
        try {
            CloseableHttpClient client = HttpClients.createDefault();
            CloseableHttpResponse response = client.execute(httpRequest);
            System.out.println ("Sensitech Settings Response Status {}"+ response.getStatusLine ().getStatusCode ());
            String responseString = EntityUtils.toString(response.getEntity (), "UTF-8");
            System.out.println(responseString);
            client.close();
        } catch (Exception ex) {
            throw new Exception ("Sensitech Exception occurred at Add Monitor API "+ ex.getMessage ());
        }
    }

    private static String buildStringEntity(String deviceId) {
        StringBuilder sb = new StringBuilder ();
        if(StringUtils.isNotBlank (deviceId)) {
            String start = "[";
            String end = "]";

            String[] devices = deviceId.split (",");
            sb.append (start);
            for (int i = 0; i < devices.length; i++) {
                sb.append ("\"");
                sb.append (devices[i]);
                sb.append ("\"");
            }
            sb.append (end);
        }
        return sb.toString ();
    }

